import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  const { title, amount, date } = props.items[0];
  const { title1, amount1, date1 } = props.items[1];
  const { title2, amount2, date2 } = props.items[2];
  const { title3, amount3, date3 } = props.items[3];

  return (
    <div className="expenses">
      <ExpenseItem title={title} amount={amount} date={date} />
    
    </div>
  );
}

export default Expenses;
